import React from 'react'
import Form from './../components/Form'
import Table from './../components/Table'
import {Layout} from 'antd'








class Home extends React.Component {

    render() {
        return (
            <Layout>
                <Form />
                    <Table/>
            </Layout>

        )
    }
}

export default Home
